import React from "react";

const Scroll =(props)=>{
    return (
        <div style={{
            overflowY: 'scroll', 
            padding:'6px', 
            height:'800px', 
            style:'none',
            boxShadow: '0px 10px 10px  inset rgb(0 0 0 / 0.4)',
            }}>

            {props.children}
        </div>
    )

};

export default Scroll;
